column8:
【スマホケース iPhone6ケース iPhone ケース 手帳 スマホポーチ 日本製 ブランド 人気 本革 革 レザー】<br>

<br>
大人気オリジナルブランド「ZARIO-GRANDEE- ザリオグランデ」から<br>
組み合わせは全部で147通りあるコンビネーションスマホケースの登場です！<br><br>

素材には日本の匠によって丁寧に仕上げられた栃木レザーを贅沢に使用。<br>
使い込むほどに革が馴染み、最高の色に変わっていきます。<br>
革独特の匂いや表情があり革好きにはたまらない逸品です。<br><br>

ベースカラーは全部で7色、さらに組み合わせ対象となるサブパーツは<br>
全部で7色、ロゴのタイプが3タイプがあり合計で147通りの組み合わせの中から<br>
お選びいただくことが可能です。<br><br>

デザイン性だけではなく機能性も抜群！<br>
スナップボタン式の開閉で横からでも縦からでも<br>
すぐにスマホを取り出せる設計になっております。<br><br>

また内部にはカードポケットが付いており、<br>
ICカードなどを入れておけばパスケースとしてもお使い頂けます。<br><br>

リング部分が取り付けられておりますので、<br>
ストラップやカラビナなどを付けて自分好みの持ち方ができ、<br>
より一層デザインを楽しむことが出来ます。<br><br>

スマホケースとしてだけではなく、<br>
ちょっとした小物入れとしてもお使い頂ける万能ポーチです。<br>


<br><br>
◆素材◆<br>
ジーンズレザー（牛革、栃木レザー）<br><br> 
◆本体サイズ◆<br>
約 H8.2×W15×D2.5cm<br><br>
◆仕様◆<br>
カードポケット×1<br><br>
◆組み合わせ◆<br>
ベースカラー：ネイビー、レッド、オレンジ、グリーン、キャメル、ブラウン、ブラック<br>
サブパーツ：タイプA、タイプB、タイプC（タイプごとにベースカラーの7色からお選びいただけます。）
<br><br>



<br>

<font size="+2" color="#CC0000" >※ご注文の前に※</font><br>

「メール便についての注意事項」を必ずご確認ください。<br>

ご注文頂きました時点で、メール便に関する注意事項にご同意いただいたとみなします。<br>
<br>
<br>
※本商品は天然素材の革、染料を使用しております。<br>

・オイルの入り具合や革の場所により、刻印（焼印）や商品の色に若干、濃淡の差がございますので、予めご了承ください。<br>

・革本来の風合いである模様（キズ、ムラ、シワ、トラ）がそのままむき出しになっております。それらを自然から生まれた世界に一つの模様として受け入れて頂ければ幸いでございます。<br>
・ロットにより色の濃淡がございます。（同じ革一枚でも部分部分で濃淡が生じる場合もございます。）ですので、同商品を二つ以上ご購入頂いた場合や、財布とキーケースなどの商品を同時購入頂いた場合でも、同じカラーでも濃淡の差異がございますので、予めご了承ください。<br>


・また現物に近い色が出る様に写真を撮っておりますが、多少濃く見えたり、薄く見えたりする場合がございます。
<br><br>


